eval("module.exports = JSON.parse(\"{\\\"data\\\":[{\\\"id\\\":\\\"0\\\",\\\"img\\\":\\\"loyalstudio.jpg\\\",\\\"contenido\\\":\\\"<p><span style=\\\\\\\"color:#0096c7\\\\\\\"><span style=\\\\\\\"font-size:20px\\\\\\\">LoyalStudio</span></span>&nbsp;<span style=\\\\\\\"color:#0058b2\\\\\\\">en un programa de cliente frecuente desarrollada por Avanze y comercializada en diversas modalidades, adapt&aacute;ndose a las particularidades de cada sector.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Esta soluci&oacute;n est&aacute; destinada a negocios que quieren disponer de una tarjeta de lealtad sencilla y segura para sus clientes, con la que podr&aacute;n consegui&nbsp;puntos de forma muy sencilla al adquirir productos o servicios en sus establecimientos.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Los puntos se obtienen mediante reglas sencillas (basadas en el importe de la operaci&oacute;n) y pueden ser canjeados o redimidos por premios o descuentos. Los puntos son grabados en la aplicaci&oacute;n, al identificar al cliente mediante tarjetas (chip, banda o c&oacute;digo de barras) u otros medios de identificaci&oacute;n.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">La Soluci&oacute;n permite abonar y consumir puntos de una forma sencilla y segura, asegurando el seguimiento de resultados y estad&iacute;sticas.</span></p>\\\\r\\\\n\\\\r\\\\n<h4><span style=\\\\\\\"font-size:20px\\\\\\\"><span style=\\\\\\\"color:#0096c7\\\\\\\">Otras Funcionalidades y Caracter&iacute;sticas</span></span></h4>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">La Soluci&oacute;n permite abonar y consumir puntos de una forma sencilla y segura, asegurando el seguimiento de resultados y estad&iacute;sticas.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Los puntos son calculados y acumulados en el sistema central de proceso, al identificar al cliente mediante la tarjeta (chip, banda o c&oacute;digo de barras). Estas tarjetas se dan a los clientes en cada comercio o son enviadas desde la administraci&oacute;n central de la red, quienes las aportar&aacute;n la pr&oacute;xima vez que quieran cargar o utilizar puntos en cualquier punto de la red de comercios asociados al programa.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">La base de Datos de clientes est&aacute; centralizada, creando por tanto un nuevo canal de comunicaci&oacute;n con los mismos. (Env&iacute;o de ofertas, extractos, etc., de forma totalmente personalizada) unificando criterios y datos en un solo punto.</span></p>\\\\r\\\\n\\\"},{\\\"id\\\":\\\"1\\\",\\\"img\\\":\\\"identimovil.jpg\\\",\\\"contenido\\\":\\\"<h4><span style=\\\\\\\"color:#0096c7\\\\\\\"><span style=\\\\\\\"font-size:20px\\\\\\\">&iquest;Qui&eacute;n necesita un ID&eacute;ntim&oacute;vil?</span></span></h4>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Aquellas empresas que, por cargas administrativas, no cuentan con el suficiente tiempo para credencializar a sus colaboradores, clientes y socios, necesitando una ayuda profesional y de forma inmediata. La impresi&oacute;n de la credencial puede ser s&oacute;lo con los datos variables de la empresa y el colaborador o puede incluir tambi&eacute;n la fotograf&iacute;a de este.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Trasladamos nuestra estaci&oacute;n de trabajo a tu empresa, para hacer los procesos de credencializaci&oacute;n de forma inmediata y con los mejores resultados.</span></p>\\\\r\\\\n\\\"},{\\\"id\\\":\\\"2\\\",\\\"img\\\":\\\"identinet.jpg\\\",\\\"contenido\\\":\\\"<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Id&eacute;ntinet es una soluci&oacute;n desarrollada por ID&eacute;ntico para la realizaci&oacute;n del proceso de identificaci&oacute;n de manera descentralizada a trav&eacute;s de una aplicaci&oacute;n WEB.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Permite adem&aacute;s el seguimiento a los procesos radicados en l&iacute;nea, donde podr&aacute;s controlar la trazabilidad de su env&iacute;o, observaciones y el estado de producci&oacute;n a nivel Nacional.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"font-size:20px\\\\\\\"><span style=\\\\\\\"color:#0096c7\\\\\\\">Ventajas de la aplicaci&oacute;n:</span></span></p>\\\\r\\\\n\\\\r\\\\n<ul>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Es totalmente personalizada de acuerdo a sus necesidades.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Se ajusta a la imagen corporativa de la empresa.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Brinda accesos de seguridad para proteger su informaci&oacute;n.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Est&aacute; adecuada a los par&aacute;metros de seguridad que su empresa necesita.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Desde la aplicaci&oacute;n puede validar las cantidades solicitadas, el estado, tipo de radicaci&oacute;n y el usuario de la persona que hace la solicitud.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Se puede ver el detalle de entrega de cada solicitud, incluso podr&aacute; descargar en l&iacute;nea la gu&iacute;a de env&iacute;o.</span></li>\\\\r\\\\n</ul>\\\\r\\\\n\\\"},{\\\"id\\\":\\\"3\\\",\\\"img\\\":\\\"mantenimiento.jpg\\\",\\\"contenido\\\":\\\"<h4><span style=\\\\\\\"color:#0096c7\\\\\\\"><span style=\\\\\\\"font-size:20px\\\\\\\">Mantenimiento preventivo</span></span></h4>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">El objetivo de este tipo de mantenimiento es anticiparse a fallas y/o da&ntilde;os que pueden tener las impresoras a causa del uso normal y desgaste de partes que, en caso de da&ntilde;arse, pueden ocasionar da&ntilde;os costosos y p&eacute;rdidas econ&oacute;micas considerables en el negocio al verse interrumpido el servicio, especialmente cuando las fallas ocurren en horas de alta concentraci&oacute;n de trabajo.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Los mantenimientos preventivos se basan en la ejecuci&oacute;n de rutinas de servicio establecidas por el fabricante de acuerdo al dise&ntilde;o y especificaciones de cada impresora. Estas rutinas incluyen diagn&oacute;sticos, pruebas, ajustes y reemplazo eventual de elementos que presenten desgaste y que puedan comprometer el desempe&ntilde;o normal de la impresora.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Un mantenimiento preventivo bien hecho y a tiempo es fundamental, especialmente en impresoras de alta utilizaci&oacute;n, para ayudar a disminuir la probabilidad de que dichos da&ntilde;os se presenten.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0096c7\\\\\\\"><span style=\\\\\\\"font-size:20px\\\\\\\">&iquest;En qu&eacute; consiste el mantenimiento preventivo?</span></span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Dentro de las labores a realizar en un Mantenimiento preventivo se hacen las siguientes:</span></p>\\\\r\\\\n\\\\r\\\\n<ul>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Recolecci&oacute;n de informaci&oacute;n con EL CLIENTE sobre fallas o funcionamiento an&oacute;malo que se puedan haber presentado en fechas recientes.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Revisi&oacute;n del estado general de las impresoras y sus componentes, verificando si tienen o no aver&iacute;as f&iacute;sicas y haci&eacute;ndolo notar al usuario.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Revisi&oacute;n de contadores de impresi&oacute;n y-o fallas registradas</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Diagn&oacute;sticos generales de las impresoras.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Limpieza interior, revisi&oacute;n y ajuste de conectores, cables, poleas, pi&ntilde;ones, y componentes internos del equipo.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Pruebas de calibraci&oacute;n y otros ajustes a trav&eacute;s de los drivers de software</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Cambio de piezas, si aplica, de acuerdo con recomendaci&oacute;n del fabricante. La garant&iacute;a cubre todas las piezas por el desgaste normal por el uso de la impresora durante un periodo de 30 meses. No incluye partes rotas por mal uso o accidentes.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Limpieza externa del equipo.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Pruebas de funcionamiento de las impresoras en conjunto con EL CLIENTE para verificar que opere en forma &oacute;ptima. En estas pruebas se verifica la funcionalidad usando las herramientas de software suministradas por el fabricante.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Llenar los reportes y documentos requeridos como comprobantes del trabajo realizado.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Hacer las sugerencias necesarias para el correcto funcionamiento de las impresoras cuando se estimen convenientes.</span></li>\\\\r\\\\n\\\\t<li><span style=\\\\\\\"color:#0058b2\\\\\\\">Una vez terminado el Mantenimiento Preventivo se hace la entrega formal de la impresora al usuario a satisfacci&oacute;n, para que &eacute;ste contin&uacute;e sus labores normalmente.</span></li>\\\\r\\\\n</ul>\\\\r\\\\n\\\\r\\\\n<h4><span style=\\\\\\\"font-size:20px\\\\\\\"><span style=\\\\\\\"color:#0096c7\\\\\\\">Mantenimiento correctivo</span></span></h4>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Este mantenimiento tiene como finalidad solucionar o como su nombre lo indica &ldquo;corregir&rdquo; los da&ntilde;os o desperfectos ocasionados por el uso y operaci&oacute;n normal de las impresoras. En otras palabras, consiste en la reparaci&oacute;n de un equipo que ha fallado y que, por lo tanto, o est&aacute; trabajando en forma deficiente o se encuentra totalmente fuera de servicio.</span></p>\\\\r\\\\n\\\\r\\\\n<p><span style=\\\\\\\"color:#0058b2\\\\\\\">Se incluye entonces la intervenci&oacute;n de nuestros expertos certificados y el eventual reemplazo de componentes que est&eacute;n originando la falla. Tambi&eacute;n incluye el soporte telef&oacute;nico, si fuere necesario, del Software de dichas impresoras de tal forma que est&eacute;n siempre disponibles a los usuarios sin ning&uacute;n tipo de inconveniente.</span></p>\\\\r\\\\n\\\"}]}\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJmaWxlIjoiLi9zcmMvanNvbi9zZXJ2aWNpb3MuanNvbi5qcyIsInNvdXJjZXMiOltdLCJtYXBwaW5ncyI6IiIsInNvdXJjZVJvb3QiOiIifQ==\n//# sourceURL=webpack-internal:///./src/json/servicios.json\n");

